/*Table structure for table `ad_article` */

DROP TABLE IF EXISTS `ad_article`;

CREATE TABLE `ad_article` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `title` text NOT NULL COMMENT 'Tiêu đề bài viết',
  `alttitle` varchar(255) DEFAULT NULL COMMENT 'Tiêu đề rút gọn',
  `header` longtext COMMENT 'Trích yếu',
  `body` longtext COMMENT 'Nội dung bài viết trên web',
  `image_path` varchar(255) DEFAULT NULL COMMENT 'Đường dẫn ảnh đại diện',
  `attributes` bigint(20) DEFAULT NULL COMMENT 'Thuộc tính của bài viết: khuyến mại, ',
  `hit_count` bigint(20) DEFAULT '0' COMMENT 'Số lượt truy cập',
  `priority` bigint(20) NOT NULL COMMENT 'Độ ưu tiên hiển thị',
  `published_time` datetime DEFAULT NULL COMMENT 'Thời gian xuất bản',
  `expiredate_time` datetime DEFAULT NULL COMMENT 'Thời gian kết thúc bản tin',
  `meta` varchar(255) DEFAULT NULL COMMENT 'Nội dung meta',
  `keywords` varchar(255) DEFAULT NULL COMMENT 'Nội dung keywords',
  `author` varchar(255) DEFAULT NULL COMMENT 'Tác giả',
  `other_link` longtext COMMENT 'Các link liên quan',
  `is_active` bigint(20) NOT NULL DEFAULT '0' COMMENT 'Trạng thái hiển thị (-1: Bản nháp, 0- Chờ duyệt, 1- Đã duyệt, 2- Đã đăng)',
  `is_hot` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'Hiển thị trên trang chủ (0- ko hiển thị, 1- hiển thị)',
  `lang` varchar(10) NOT NULL COMMENT 'Đa ngôn ngữ',
  `slug` varchar(255) NOT NULL COMMENT 'chuyển đổi url',
  `category_id` bigint(20) DEFAULT NULL COMMENT 'Id của danh mục tin tức',
  `created_by` bigint(20) DEFAULT NULL,
  `updated_by` bigint(20) DEFAULT NULL,
  `created_at` datetime NOT NULL,
  `updated_at` datetime NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `slug` (`slug`),
  KEY `category_id_idx` (`category_id`),
  KEY `created_by_idx` (`created_by`),
  KEY `updated_by_idx` (`updated_by`)
) ENGINE=MyISAM AUTO_INCREMENT=215 DEFAULT CHARSET=utf8;

/*Data for the table `ad_article` */

insert  into `ad_article`(`id`,`title`,`alttitle`,`header`,`body`,`image_path`,`attributes`,`hit_count`,`priority`,`published_time`,`expiredate_time`,`meta`,`keywords`,`author`,`other_link`,`is_active`,`is_hot`,`lang`,`slug`,`category_id`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (213,'Khuyễn mãi hấp dẫn - giảm 20% cho khách ở tháng','','Giám giá sâu dành cho khách nghỉ tháng lên đến 20% bắt đầu từ 01/09/2017. Đây là ưu đãi đặc biệt nhân dịp khai trương của Nehob City','<p>Nh&acirc;n dịp khai trương đặc biệt của Nehob City Apartment, Ch&uacute;ng t&ocirc;i tr&acirc;n trọng d&agrave;nh đến qu&yacute; kh&aacute;ch h&agrave;ng chương tr&igrave;nh giảm gi&aacute; đặc biệt l&ecirc;n đến 20% cho to&agrave;n bộ c&aacute;c ph&ograve;ng của Nehob City 1. Chụ thể:</p>\r\n\r\n<table border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:766px\">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"8\" style=\"height:18px; width:766px\">\r\n			<p style=\"text-align: center;\">BẢNG GI&Aacute; PH&Ograve;NG NEHOB CITY</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"8\" style=\"height:18px; width:766px\">\r\n			<p style=\"text-align: center;\"><strong>NEHOB CITY PRICE LIST</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"4\" style=\"height:18px; width:416px\">\r\n			<p>Đơn vị (Unit): USD</p>\r\n			</td>\r\n			<td colspan=\"4\" style=\"height:18px; width:350px\">\r\n			<p style=\"text-align: right;\"><strong>SALE OFF 20%/ PRICE MONTH</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:81px; width:151px\">\r\n			<p style=\"text-align: center;\">Loại ph&ograve;ng</p>\r\n			</td>\r\n			<td style=\"height:81px; width:104px\">\r\n			<p style=\"margin-left: -14.2pt; text-align: center;\">Số ph&ograve;ng</p>\r\n			</td>\r\n			<td style=\"height:81px; width:76px\">\r\n			<p style=\"text-align: center;\">Gi&aacute; ng&agrave;y</p>\r\n			</td>\r\n			<td style=\"height:81px; width:85px\">\r\n			<p style=\"text-align: center;\">Gi&aacu